import React from "react";
import styled from "styled-components";
import Slogan_Template from "./Slogan_Template";
import Slogan_Header from "./Slogan_Header";
import Slogan_Domain from "./Slogan_Domain";

const MainBlock = styled.div`
  width: 100vw; // %로 하면 오류가 뜨는데 이유 찾아보기.
  height: 100vh;
  background: #e6e6e6;
`;

function Main() {
  return (
    <MainBlock>
      <Slogan_Template>
        <Slogan_Header />
        <Slogan_Domain />
      </Slogan_Template>
    </MainBlock>
  );
}

export default Main;
